package axleham.core.npc;

public enum NPC_Skins {

    SKIN_1("steampunk_1",
            "",
            ""
    ),
    SKIN_2("steampunk_2",
            "",
            ""
    ),
    SKIN_3("steampunk_3",
            "",
            ""
    ),
    SKIN_4("steampunk_4",
            "",
            ""
    ),
    SKIN_5("steampunk_5",
            "",
            ""
    );

    private String name;
    private String texture;
    private String signature;

    NPC_Skins(String name, String texture, String signature) {

        this.name = name;
        this.texture = texture;
        this.signature = signature;


    }

    public String getName() {
        return name;
    }

    public String getTexture() {
        return texture;
    }

    public String getSignature() {
        return signature;
    }

}
